// src/components/Header.js
import React from 'react';
import './header.css';

function Header() {
  return (
    <header className="header">
      <h1>Data Profile Website</h1>
      <nav>
        <ul>
          <li>Home</li>
          {/* Tambahkan item navigasi lain jika diperlukan */}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
